import React from 'react'
import { Box, Dialog, DialogActions, DialogContent,  DialogContentText, DialogTitle } from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles'
import PropTypes from 'prop-types'

const styles = (theme) => ({
    root : {
        width : "100vw",
        height : "100vh",
        backgroundColor : "rgba(0,0,0,0.3)",
        display : "flex",
        justifyContent : "center",
        alignItems : "center",
        position : "absolute",

    },
    map : {
        backgroundImage : 'url(/static)'    
    }
})

const Location = ({ classes, handleClose, open }) => {
    return <Box className={classes.root}>
        <Dialog
        open={open}
        onClose={handleClose}
        aria-labelledby="alert-dialog-title"
        aria-describedby="alert-dialog-description"
      >
        <DialogTitle id="alert-dialog-title">{"Use Google's location service?"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-description">
              <Box className={classes.map} />
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          {/* <Button onClick={handleClose} color="primary">
            Disagree
          </Button> */}
          {/* <Button onClick={handleClose} color="primary" autoFocus>
            Agree
          </Button> */}
        </DialogActions>
      </Dialog>
    </Box>
}

Location.propTypes = {
    open : PropTypes.bool,
    handleClose : PropTypes.func,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Location)
